pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./DFKEarnBase.sol";
import "./interfaces/IDFKQuest.sol";

contract AutoQuest is DFKEarnBase {
    address public constant DFKQuest = 0x5100Bd31b822371108A0f63DCFb6594b9919Eaf4;
    address public constant DFKTrainingQuest = 0xAa9a289ce0565E4D6548e63a441e7C084E6B52F6;
    address public constant DFKJewelToken = 0x72Cb10C6bfA5624dD07Ef608027E366bd690048F;
    address public constant DFKGoldToken = 0x3a4EDcf3312f44EF027acfd8c21382a5259936e7;
    address public constant DFKVender = 0xe53BF78F8b99B6d356F93F41aFB9951168cca2c6;
    address public constant DFKAlchemist = 0x38e76972BD173901B5E5E43BA5cB464293B80C31;


    using EnumerableSet for EnumerableSet.AddressSet;
    EnumerableSet.AddressSet private operators;

    uint public questFee;
    uint public miningJewelFeeRate;
    uint public miningJewelFeeThreshold;
    uint public trainingQuestFeeRate;
    uint public trainingQuestFeeThreshold;
    uint public sellItemFeeRate;
    uint public sellItemFeeThreshold;

    event QuestFeeChanged(uint256 newValue, uint256 oldValue);

    constructor(address _accountFactory) DFKEarnBase(_accountFactory) {
        questFee = 0.12 ether;
        miningJewelFeeRate = 250;           // in bps
        miningJewelFeeThreshold = 0.25e18;  // 0.25 jewel
        trainingQuestFeeRate = 250;         // in bps
        trainingQuestFeeThreshold = 200e3;  // 200 gold
        sellItemFeeRate = 250;              // in bps
        sellItemFeeThreshold = 200e3;       // 200 gold
    }

    modifier onlyOperator() {
        require(operators.contains(msg.sender), "DFKEarn: not operator");
        _;
    }

    function startQuest(
        address _account,
        uint256[] calldata _heroIds,
        address _quest,
        uint8 _attempts
    ) 
        external
        onlyOperator
    {
        chargeQuestFee(_account, _heroIds.length);
        IAccount(_account).functionCall(DFKQuest, abi.encodeWithSignature(
            "startQuest(uint256[],address,uint8)",
            _heroIds,
            _quest,
            _attempts
        ));
    }

    function startQuestWithData(
        address _account,
        uint256[] calldata _heroIds,
        address _quest,
        uint8 _attempts,
        IDFKQuest.QuestData calldata _questData
    )
        external
        onlyOperator
    {
        chargeQuestFee(_account, _heroIds.length);
        IAccount(_account).functionCall(DFKQuest, abi.encodeWithSignature(
            "startQuestWithData(uint256[],address,uint8,(uint256,uint256,uint256,uint256,int256,int256,string,string,address,address,address,address))",
            _heroIds,
            _quest,
            _attempts,
            _questData
        ));
    }

    function cancelQuest(address _account, uint256 _heroId) external onlyOperator {
        IAccount(_account).functionCall(DFKQuest, abi.encodeWithSignature(
            "cancelQuest(uint256)",
            _heroId
        ));
    }

    function completeQuest(address _account, uint256 _heroId) external onlyOperator {
        uint256 oldBalance = IERC20(DFKJewelToken).balanceOf(_account);
        IAccount(_account).functionCall(DFKQuest, abi.encodeWithSignature(
            "completeQuest(uint256)",
            _heroId
        ));
        uint256 newBalance = IERC20(DFKJewelToken).balanceOf(_account);
        chargeEarnings(
            _account,
            DFKJewelToken,
            newBalance - oldBalance,
            miningJewelFeeThreshold,
            miningJewelFeeRate
        );
    }

    function startTrainingQuest(
        address _account,
        uint256[] calldata _heroIds,
        address _quest,
        uint8 _attempts,
        uint8 _level
    ) 
        external
        onlyOperator
    {
        chargeQuestFee(_account, _heroIds.length);
        IAccount(_account).functionCall(DFKTrainingQuest, abi.encodeWithSignature(
            "startQuest(uint256[],address,uint8,uint8)",
            _heroIds,
            _quest,
            _attempts,
            _level
        ));
    }

    function cancelTrainingQuest(address _account, uint256 _heroId) external onlyOperator {
        IAccount(_account).functionCall(DFKTrainingQuest, abi.encodeWithSignature(
            "cancelQuest(uint256)",
            _heroId
        ));
    }

    function completeTrainingQuest(address _account, uint256 _heroId) external onlyOperator {
        uint256 oldBalance = IERC20(DFKGoldToken).balanceOf(_account);
        IAccount(_account).functionCall(DFKTrainingQuest, abi.encodeWithSignature(
            "completeQuest(uint256)",
            _heroId
        ));
        uint256 newBalance = IERC20(DFKGoldToken).balanceOf(_account);
        chargeEarnings(
            _account,
            DFKGoldToken,
            newBalance - oldBalance,
            trainingQuestFeeThreshold,
            trainingQuestFeeRate
        );
    }

    function craftPotion(address _account, address _item, uint256 _heroId) external onlyOperator {
        IAccount(_account).functionCall(DFKAlchemist, abi.encodeWithSignature(
            "consumeItem(address,uint256)",
            _item,
            _heroId
        ));
    }

    function sellToVender(address[] calldata _items, uint[] calldata _amounts) external {
        address account = getAccount(msg.sender);
        uint256 oldBalance = IERC20(DFKGoldToken).balanceOf(account);
        for (uint i = 0; i < _items.length; i++) {
            uint balance = IERC20(_items[i]).balanceOf(account);
            require(_amounts[i] <= balance, "DFKEarn: insufficient balance");
            IAccount(account).functionCall(_items[i], abi.encodeWithSignature(
                "approve(address,uint256)",
                DFKVender,
                _amounts[i]
            ));
            IAccount(account).functionCall(DFKVender, abi.encodeWithSelector(
                bytes4(0x096c5e1a),
                _items[i],
                _amounts[i]
            ));
        }
        uint256 newBalance = IERC20(DFKGoldToken).balanceOf(account);
        chargeEarnings(
            account,
            DFKGoldToken,
            newBalance - oldBalance,
            sellItemFeeThreshold,
            sellItemFeeRate
        );
    }

    function chargeQuestFee(
        address _account,
        uint _heroCount
    )
        private
    {
        uint256 totalQuestFee = _heroCount * questFee;
        require(_account.balance >= totalQuestFee, "AutoQuest: insufficent balance");
        IAccount(_account).sendValue(payable(admin), totalQuestFee);
    }

    function chargeEarnings(
        address account,
        address token,
        uint earnings,
        uint threshold,
        uint feeRate
    )
        private
    {
        if (earnings >= threshold) {
            uint256 fee = earnings * feeRate / 10000;
            IAccount(account).functionCall(token, abi.encodeWithSignature(
                "transfer(address,uint256)",
                admin,
                fee
            ));
        }
    }

    function setQuestFee(uint256 _questFee) external onlyAdmin {
        uint256 oldValue = questFee;
        questFee = _questFee;
        emit QuestFeeChanged(questFee, oldValue);
    }

    function setMiningJewelFeeRate(uint256 _miningJewelFeeRate) external onlyAdmin {
        miningJewelFeeRate = _miningJewelFeeRate;
    }

    function setMiningJewelFeeThreshold(uint256 _miningJewelFeeThreshold) external onlyAdmin {
        miningJewelFeeThreshold = _miningJewelFeeThreshold;
    }

    function setTrainingQuestFeeRate(uint256 _trainingQuestFeeRate) external onlyAdmin {
        trainingQuestFeeRate = _trainingQuestFeeRate;
    }

    function setTrainingQuestFeeThreshold(uint256 _trainingQuestFeeThreshold) external onlyAdmin {
        trainingQuestFeeThreshold = _trainingQuestFeeThreshold;
    }

    function setSellItemFeeRate(uint256 _sellItemFeeRate) external onlyAdmin {
        sellItemFeeRate = _sellItemFeeRate;
    }

    function setSellItemFeeThreshold(uint256 _sellItemFeeThreshold) external onlyAdmin {
        sellItemFeeThreshold = _sellItemFeeThreshold;
    }

    function updateOperator(address _operator, bool _add) external onlyAdmin {
        if (_add) {
            operators.add(_operator);
        } else {
            operators.remove(_operator);
        }
    }

    function getOperators() public view returns (address[] memory) {
        uint length = operators.length();
        address[] memory result = new address[](length);
        for (uint i = 0; i < length; i++) {
            result[i] = operators.at(i);
        }
        return result;
    }
}
","keccak256":"0x526a9013f581af1617b2fd010473954cf84405a99eba5416e04b0c392e968b35","license":"MIT"},"contracts/DFKEarnBase.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "./interfaces/IAccount.sol";
import "./interfaces/IAccountFactory.sol";

contract DFKEarnBase {
    address public admin;
    address public pendingAdmin;

    address public immutable accountFactory;

    event NewAdmin(address newAdmin, address oldAdmin);
    event NewPendingAdmin(address newPendingAdmin, address oldPendingAdmin);

    constructor(address _accountFacotry) {
        admin = msg.sender;
        emit NewAdmin(admin, address(0));
        accountFactory = _accountFacotry;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "DFKEarn: not admin");
        _;
    }

    function withdrawalNativeToken(uint256 _amount) external {
        address account = getAccount(msg.sender);
        require(_amount <= account.balance, "DFKEarn: insufficient balance");
        IAccount(account).sendValue(payable(msg.sender), _amount);
    }

    function batchWithdrawalERC20Tokens(
        address[] calldata _erc20Tokens,
        uint256[] calldata _amounts
    )
        external
    {
        address account = getAccount(msg.sender);
        for (uint i = 0; i < _erc20Tokens.length; i++) {
            uint256 balance = IERC20(_erc20Tokens[i]).balanceOf(address(account));
            require(_amounts[i] <= balance, "DFKEarn: insufficient balance");
            IAccount(account).functionCall(_erc20Tokens[i], abi.encodeWithSignature(
                "transfer(address,uint256)",
                msg.sender,
                _amounts[i]
            ));
        }
    }

    function batchWithdrawalERC721Tokens(
        address _erc721Token,
        uint256[] calldata _tokenIds
    )
        external
    {
        address account = getAccount(msg.sender);
        for (uint i = 0; i < _tokenIds.length; i++) {
            address owner = IERC721(_erc721Token).ownerOf(_tokenIds[i]);
            require(owner == account, "DFKEarn: not owner");
            IAccount(account).functionCall(_erc721Token, abi.encodeWithSignature(
                "safeTransferFrom(address,address,uint256)",
                account,
                msg.sender,
                _tokenIds[i]
            ));
        }
    }

    function setPendingAdmin(address _newPendingAdmin) external onlyAdmin {
        require(
            _newPendingAdmin != admin && _newPendingAdmin != address(0),
            "DFKEarn: invalid address"
        );
        if (pendingAdmin != _newPendingAdmin) {
            address oldPendingAdmin = pendingAdmin;
            pendingAdmin = _newPendingAdmin;
            emit NewPendingAdmin(pendingAdmin, oldPendingAdmin);
        }
    }

    function acceptAdmin() external {
        require(
            msg.sender == pendingAdmin && msg.sender != address(0),
            "DFKEarn: not pending admin"
        );
        address oldAdmin = admin;
        address oldPendingAdmin = pendingAdmin;
        admin = pendingAdmin;
        pendingAdmin = address(0);
        emit NewAdmin(admin, oldAdmin);
        emit NewPendingAdmin(pendingAdmin, oldPendingAdmin);
    }

    function tryGetAccount(address user) public view returns (address) {
        return IAccountFactory(accountFactory).accounts(user);
    }

    function getAccount(address user) public view returns (address) {
        address account = tryGetAccount(user);
        require(account != address(0), "DFKEarn: no account");
        return account;
    }

    function hasAccount(address user) public view returns (bool) {
        return tryGetAccount(user) != address(0);
    }
}
